import httpService from '@/service/httpService'

export default {
  // 获取小脉宝消息
  getXiaomaibao(page) {
    return httpService.get(`/app/message/get-system-msg`, {
      page
    })
  },
  // 获取推送消息
  getPush(page = 1, type = 2) {
    return httpService.get(`/app/get-push-msg`, {
      page,
      type
    })
  },
  // 获取用户消息列表
  getUserlist() {
    return httpService.get(`/app/message/get-group-user-msg`)
  },
  // 获取单个用户消息
  getUserdetail(from_user_id) {
    return httpService.get(`/app/message/get-user-msg`, {
      from_user_id
    })
  },
  // 获取人气列表
  getPoplist(page) {
    return httpService.get(`/app/message/popularity`, {
      page
    })
  },
  // 根据id获取网页
  getTemp(id) {
    return httpService.get(
      `/front/personal_page/default_template?user_id=` + id
    )
  },
  // 获取感兴趣列表
  getFovourlist() {
    return httpService.get(`/app/message/interested`)
  },
  // 删除用户消息
  delUsermsg(from_user_id) {
    return httpService.post(`/app/message/del-user-msg`, {
      from_user_id
    })
  }
}
